import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'; // Import Router, Switch, and Route
import './App.css';
import Landing from "./components/routes/landing/Landing";
import CreatePost from "./components/routes/createPost/CreatePost";

function App() {
    return (
        <Router> {/* Wrap your routes with the Router component */}
            <Switch>
                <Route path="/" exact component={Landing} />
                <Route path="/create-post" component={CreatePost} />
            </Switch>
        </Router>
    );
}

export default App;
